class Solution {
public:

    using PointSet = std::set<std::pair<int, int>, std::greater<std::pair<int, int>>>;

    void insertOrRemove(PointSet &points, int x, int y)
    {
            auto ret = points.insert(std::make_pair(x, y));
            if (!ret.second) {
                points.erase(ret.first);
            }
    }

    bool isRectangleCover(std::vector<std::vector<int>> &rectangles)
    {
        PointSet points;
        int minX = std::numeric_limits<int>::max();
        int maxX = std::numeric_limits<int>::min();
        int minY = std::numeric_limits<int>::max();
        int maxY = std::numeric_limits<int>::min();
        int area = 0;

        for (auto &rect : rectangles) {
            //std::cout << rect[0] << "," << rect[1] << "," << rect[2] << "," << rect[3] << std::endl;
            minX = std::min(minX, rect[0]);
            maxX = std::max(maxX, rect[2]);
            minY = std::min(minY, rect[1]);
            maxY = std::max(maxY, rect[3]);


            insertOrRemove(points, rect[0], rect[1]);
            insertOrRemove(points, rect[0], rect[3]);
            insertOrRemove(points, rect[2], rect[1]);
            insertOrRemove(points, rect[2], rect[3]);

            area += (rect[2] - rect[0]) * (rect[3] - rect[1]); 
        }

        //std::cout << "minX = " << minX << " minY = " << minY << " maxX = " << maxX << " maxY = " << maxY << " area = " << area << std::endl;
        if ((maxX - minX) * (maxY - minY) != area) {
            return false;
        }

        if (points.size() != 4) {
            return false;
        }

        if (points.find(std::make_pair(minX, minY)) == points.end()
                || points.find(std::make_pair(minX, maxY)) == points.end()
                || points.find(std::make_pair(maxX, minY)) == points.end()
                || points.find(std::make_pair(maxX, maxY)) == points.end()) {
            return false;
        }

        return true;
    }
};

